import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import "./welcome.css";

class Welcome extends Component {
    render () {
        return (
            <div className="container">
                <div className="title">
                    <h1>Discover and Play</h1>
                    <h2>Explore the Museum in a whole new way</h2>
                    <label for="email-input">E-mail</label>
                    <input
                        type="text"
                        id="email-input"
                        placeholder="Type your email here"
                    />
                    <p>Input your email if you would like to be added to our marketing list and to participate in future prize raffles.</p>
                </div>
                <Link to="/account-type-register">
                    <div className="register-btn-back">
                        <p>Sign Up</p>
                    </div>
                </Link>
            </div>
        );
    }
}

export default Welcome;
